fields.text:
14 и 15 декабря в стенах Молодежного центра Центрального кампуса УНПК «МУК» прошел международный гранд-турнир по парламентским дебатам XVI MANAS CUP 2019.

Турнир организовали «Дебатный клуб «Манас» и «Бишкекский дебатный центр». Спонсорскую помощь оказали Управление верховного комиссара по правам человека ООН в лице Эркина Исакулова и Петера Надерера и УНПК «МУК».

С напутственной речью официальный турнир открыла проректор Центрального кампуса Карабалаева С.Б.

В турнире приняли участие 45 команд из следующих учебных заведений:

Казахстан:
Назарбаев университет (г.Астана);
Астанинский университет информационных технологий;
ЕНУ им. Гумелева (Евразийский национальный институт) (г.Астана);
Казахский гуманитарный-юридический университет им. М.С. Нарикбаева (КазГЮУ) (г.Астана);
Казахстанский институт менеджмента, экономики и прогнозирования (KIMEP) (г.Алматы);
Международный университет информационных технологий (МУИТ) (г.Алматы);
Казахский национальный университет им. Аль-Фараби (г.Алматы);
Алматинский университет энергетики и связи (УЭС);
Гимназия №25 им. Ильяса Есенберлина;
Евразийский технологический колледж;
Назарбаев интеллектуальная школа физико-математического направления (НИШФМ);
Республиканская физико-математическая школа (РФМШ).
Кыргызстан:
Кыргызский государственный юридический университет;
Американский университет Центральной Азии;
Кыргызско-Российский славянский университет;
Кыргызский государственный технический университет им. Раззакова;
Бишкекский гуманитарный университет;
Кыргызско-Турецкий университет «Манас»;
УНПК «МУК»;
«Билимкана» школа-гимназия №26;
Школа-гимназия №8;
Средняя школа-гимназия №10 им. А.С. Макаренко;
ишкекский Кыргызско-Турецкий женский лицей «Айчурок»;
УВК школа-гимназия №20;
УВК школа-гимназия №70;
Эколого-экономический лицей №65;
Школа-гимназия №64;
КЭиС при КЭУ им. Рыскулбекова;
УВК школа-гимназия №12;
Кыргызско-Корейский колледж;
СОШ КРСУ.
По итогам турнира первое место заняла команда из Назарбаев университета, второе и третье место занятии команды из ЕНУ им. Гумелева и KIMEP.
